import React, { useState, useEffect } from 'react';
import {
  Typography,
  Box,
  Paper,
  Grid,
  Card,
  CardContent,
  CircularProgress,
  Alert,
  Button,
} from '@mui/material';
import SettingsIcon from '@mui/icons-material/Settings';
import Layout from '../components/Layout';
import api from '../services/api';

function Panchang() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [settings, setSettings] = useState(null);
  const [panchangData, setPanchangData] = useState(null);

  useEffect(() => {
    fetchPanchangData();
  }, []);

  const fetchPanchangData = async () => {
    try {
      setLoading(true);
      // Fetch panchang display settings
      const settingsRes = await api.get('/api/v1/panchang/display-settings/');
      setSettings(settingsRes.data);
      
      // TODO: Fetch actual panchang data when API is available
      // const panchangRes = await api.get('/api/v1/panchang/today');
      // setPanchangData(panchangRes.data);
    } catch (err) {
      console.error('Error fetching panchang data:', err);
      if (err.response?.status !== 404) {
        setError('Failed to load panchang data');
      }
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Layout>
        <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '400px' }}>
          <CircularProgress />
        </Box>
      </Layout>
    );
  }

  return (
    <Layout>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4" component="h1" sx={{ fontWeight: 'bold' }}>
          Today's Panchang
        </Typography>
        <Button
          variant="outlined"
          startIcon={<SettingsIcon />}
          onClick={() => window.location.href = '/settings'}
        >
          Display Settings
        </Button>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      {settings && (
        <Paper sx={{ p: 2, mb: 3, bgcolor: '#FFF3E0' }}>
          <Typography variant="body2" color="text.secondary">
            Display Mode: <strong>{settings.display_mode}</strong> | 
            Language: <strong>{settings.primary_language}</strong> | 
            Show on Dashboard: <strong>{settings.show_on_dashboard ? 'Yes' : 'No'}</strong>
          </Typography>
        </Paper>
      )}

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Panchang Information
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Connect to panchang service API to display today's tithi, nakshatra, 
                yoga, karana, and other panchang details.
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Display Settings
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Configure what panchang elements to display, language preferences, 
                and visual settings.
              </Typography>
              <Button
                variant="contained"
                sx={{ mt: 2 }}
                onClick={() => window.location.href = '/settings'}
              >
                Configure Settings
              </Button>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Layout>
  );
}

export default Panchang;
